import React from 'react';
import './Roller2.css';

const Roller2 = () => {
  return (
    <div className="roller2">
      <div className="frame186">
        <span className="text-1">Faster</span>
        <span className="text-2">Speed up your painting projects with our high-performance drone, delivering rapid, consistent results.</span>
      </div>
      <div className="frame184">
        <span className="text-1">Precise</span>
        <span className="text-2">Achieve pinpoint accuracy with every spray, ensuring flawless coverage and minimal waste.</span>
      </div>
      <div className="frame185">
        <span className="text-1">Advanced</span>
        <span className="text-2">Harness cutting-edge technology for superior performance and unparalleled efficiency.</span>
      </div>
      <div className="frame183">
        <span className="text-1">Safer</span>
        <span className="text-2">Designed with safety in mind, our system reduces risks and enhances operator protection.</span>
      </div>
      <div className="ellipse">
      </div>
      <div className="ellipse2">
      </div>
      <img src="/assets/0f91d2bb-5a92-400b-84a5-e5173529d1b2_1.png" alt="Drone spray painting demonstration" className="image-0f91d2bb" />
    </div>
  );
};

export default Roller2;
